import React from 'react';
import c from './Profile.module.css';
import MyPosts from './MyPosts/MyPosts';
import '../../icons/1-49.png';

function Profile() {
    return (
        <div className= {c.content}>
        <img src='1-49' />
        <div className = 'item'>Main content</div>
        <MyPosts />
      </div>
    );
}

export default Profile;
